import styled from 'styled-components'

export const BackgroundVideo = styled.div`
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;

  video {
    // 最小宽高是整个父盒子内容区
    min-width: 100%;
    min-height: 100%;
  }
`

